INSERT INTO products (created,name,price,description) VALUES
	('1999-01-08 04:05:06','IPHONE X', 50000, 'is a smartphone designed, developed and marketed by Apple Inc. The 11th generation of the iPhone, it was available to pre-order on October 27, 2017, and was released on November 3, 2017. The naming of the iPhone X (skipping the iPhone 9) is to mark the 10th anniversary of the iPhone.'),
	('1999-01-08 04:05:06','IPHONE SE',80000,'The third-generation iPhone SE (also known as the iPhone SE 3 or the iPhone SE 2022) is a smartphone designed and developed by Apple Inc. It is part of the 15th generation of the iPhone, alongside the iPhone 13/13 mini and iPhone 13 Pro/13 Pro Max models. Apple announced the third-generation iPhone SE on March 8, 2022, which succeeded the second-generation iPhone SE'),
	('1999-01-08 04:05:06','IPHONE 7',30500, 'The iPhone 7 and iPhone 7 Plus are smartphones designed, developed, and marketed by Apple Inc. They are the tenth generation of the iPhone. They were announced on September 7, 2016, at the Bill Graham Civic Auditorium in San Francisco by Apple CEO Tim Cook, and were released on September 16, 2016, succeeding the iPhone 6, iPhone 6 Plus, iPhone 6S and iPhone 6S Plus as the flagship devices in the iPhone series. Apple also released the iPhone 7 and iPhone 7 Plus in numerous countries worldwide throughout September and October 2016. They were succeeded as flagship devices by the iPhone 8 and iPhone 8 Plus on September 22, 2017');